        super(props)

        this.state = {
            username:'',
            hasLoginFailed: false,
            showSuccessMessage: false
        }
        this.responseGoogle = this.responseGoogle.bind(this)
    }

    responseGoogle(response) {
        console.log("RESPONSE", response);
